import React from 'react';
import { NavLink } from 'react-router-dom';

function Navbar() {
  return (
    <div>
      <ul className="navbar">
        <li><NavLink activeClassName="active" exact to="/">Acceuil</NavLink></li>
        <li><NavLink activeClassName="active" to="/aboutus">A propos du site</NavLink></li>
        <li><NavLink activeClassName="active" to="/contactus">Contact</NavLink></li>
      </ul>
    </div>
  )
};

export default Navbar;
